// src/components/Navbar.js
import React, { useEffect, useMemo, useRef, useState } from "react";
import { Link, NavLink, useLocation } from "react-router-dom";
import { useAuth } from "../context/AuthContext";

const Navbar = () => {
  const { user, logout } = useAuth();
  const isAdmin = user?.role === "ADMIN";
  const location = useLocation();

  const [openMore, setOpenMore] = useState(false);
  const moreRef = useRef(null);

  // Close dropdown on route change
  useEffect(() => {
    setOpenMore(false);
  }, [location.pathname]);

  // Close dropdown on outside click / ESC
  useEffect(() => {
    const onDocClick = (e) => {
      if (!moreRef.current) return;
      if (!moreRef.current.contains(e.target)) setOpenMore(false);
    };
    const onEsc = (e) => {
      if (e.key === "Escape") setOpenMore(false);
    };
    document.addEventListener("mousedown", onDocClick);
    document.addEventListener("keydown", onEsc);
    return () => {
      document.removeEventListener("mousedown", onDocClick);
      document.removeEventListener("keydown", onEsc);
    };
  }, []);

  // ✅ Main links for all logged-in users
  const mainLinks = useMemo(
    () => [
      { to: "/", label: "Home" },
      { to: "/crops", label: "Crops" },
      { to: "/education", label: "Education" },
      { to: "/complaints", label: "Complaints" },
      { to: "/search", label: "Search" },
    ],
    []
  );

  // ✅ Extra links shown ONLY to admin (inside 3-dot menu)
  const adminMoreLinks = useMemo(
    () => [
      { to: "/subsidies", label: "Subsidies" },
      { to: "/admin", label: "Admin Panel" },
      { to: "/analytics", label: "Analytics" },
      { to: "/verification", label: "Verification" },
      { to: "/ledger", label: "Ledger" },
      { to: "/notifications", label: "Notifications" },
      { to: "/chatbot", label: "Chatbot" },
    ],
    []
  );

  return (
    <div className="navbar">
      <div className="navbar-inner">
        <div className="nav-left">
          <div className="brand">
            <div className="brand-badge" />
            <Link to="/" style={{ fontWeight: 800 }}>
              AgroTrust
            </Link>
          </div>

          {/* Main links */}
          <div className="nav-links">
            {user &&
              mainLinks.map((l) => (
                <NavLink
                  key={l.to}
                  to={l.to}
                  className={({ isActive }) =>
                    `nav-link ${isActive ? "active" : ""}`
                  }
                  end={l.to === "/"}
                >
                  {l.label}
                </NavLink>
              ))}
          </div>
        </div>

        <div className="nav-right">
          {/* ✅ Admin-only 3 dots dropdown */}
          {user && isAdmin && (
            <div className="more-wrap" ref={moreRef}>
              <button
                type="button"
                className={`icon-btn ${openMore ? "active" : ""}`}
                aria-label="More"
                aria-haspopup="menu"
                aria-expanded={openMore}
                onClick={() => setOpenMore((v) => !v)}
                title="More"
              >
                ⋯
              </button>

              {openMore && (
                <div className="more-menu" role="menu">
                  {adminMoreLinks.map((l) => (
                    <NavLink
                      key={l.to}
                      to={l.to}
                      className={({ isActive }) =>
                        `more-item ${isActive ? "active" : ""}`
                      }
                      role="menuitem"
                    >
                      {l.label}
                    </NavLink>
                  ))}
                </div>
              )}
            </div>
          )}

          {user ? (
            <>
              <span className="pill">
                {user.name} ({user.role})
              </span>
              <button className="btn btn-danger" onClick={logout}>
                Logout
              </button>
            </>
          ) : (
            <>
              <Link className="btn" to="/login">
                Login
              </Link>
              <Link className="btn btn-primary" to="/register">
                Register
              </Link>
            </>
          )}
        </div>
      </div>
    </div>
  );
};

export default Navbar;
